import React from "react";

export default (props) => {
    var myJSON = JSON.stringify(props.data);
    console.log("PRops " + myJSON);
    console.log("PRops " + props.albumLevel);

    document.getElementById("photo_"+this.state.photoLevel).className += "visible";

    // let displayAlbum = !props.data.albumLevel ? "hide": null;
    return(
        <div>
        {/* <div className={props.albumLevel === 0 ? null : "hide"} onClick={props.handleClick} id={props.data.id}> */}
        <div className={props.photoLevel === 0 ? null : "hide"} onClick={props.handleClick} id={props.data.id}>
            <h2>Album is on: {props.data.albumId}</h2>
            {/* <h2>ID: {props.data.photoDB.id}</h2>
            <h2>Title: {props.data.photoDB.title}</h2> */}
            <img src={props.data.thumbnailUrl} className="App-logo" alt="props.data.title" />
            {/* <h2 style={{color:"#fff"}}>I'm very lazy ::::::></h2> */}
            <p>{props.data.url} - {props.albumLevel ? "True" : "false"}</p>
        </div>
        <div className={props.photoLevel === 0 ? "hide" : null} onClick={props.handleClick} id={"photo_" + props.data.id}>
        <img src={props.data.url} className="App-logo" alt="props.data.title" />
        </div>
        
        </div>
    )
}

